import './App.css';
import Player from './Player'
import bgVideo from './Caves.mp4'

function App() {
  return (
    <div className="App">
      <header className="App-header">
          <video autoPlay loop muted>
            <source src={bgVideo} type="video/mp4" style={{}} />
          </video>
          <Player />
      </header>
    </div>
  );
}

export default App;
